  false,\n\t\"url\": null,\n\t\"notes\": \"The Bear River Migratory Bird Refuge National
  Wildlife Refuge 2003 annual Habitat Management Plan provides a long-term vision
  and specific guidance on managing habitats for the resources of concern at Bear
  River, to facilitate continuity in management programs. Refuge background, resources
  of concern, and habitat management goals and objectives are discussed. Management
  strategies and prescriptions then identify how and the specific means by which management
  and monitoring strategies will be implemented. Appendices follow.\",\n\t\"owner_org\":
